INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-416.5, 1, 0.0, "2025/01/31 12:00:00", 62, 1, "2030/01/01 14:59:59", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 190801, 3.414, "カリン", 1000001, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-416.5, 1, 0.0, "2025/01/31 12:00:00", 62, 1, "2030/01/01 14:59:59", "ミッションをクリアして、\n報酬をゲットしましょう！", 190801, 3.099, "カリン", 1000002, 2, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-416.5, 1, 0.0, "2025/01/31 12:00:00", 63, 1, "2030/01/01 14:59:59", "受け取ることができる\n報酬があるようです\n確認してみてください", 190801, 2.801, "カリン", 1000003, 3, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-416.5, 1, 0.0, "2025/01/31 12:00:00", 63, 2, "2030/01/01 14:59:59", "報酬がもらえますよ！\nチェックしてみてください", 190801, 0.0, "カリン", 1000004, 4, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-363.0, 1, 0.0, "2025/01/31 12:00:00", 64, 2, "2030/01/01 14:59:59", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 190801, 2.12, "カリン", 1000005, 5, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-363.0, 1, 0.0, "2025/01/31 12:00:00", 64, 1, "2030/01/01 14:59:59", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 190801, 1.68, "カリン", 1000006, 6, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-363.0, 1, 0.0, "2025/01/31 12:00:00", 64, 2, "2030/01/01 14:59:59", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 190801, 2.33, "カリン", 1000007, 7, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10201, -6.0, "2025/01/31 12:00:00", 61, 3, "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 133701, 5.18, "ラビリスタ", 1020101, 101, 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10201, -2.0, "2025/01/31 12:00:00", 61, 1, "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 133901, 8.77, "クリスティーナ", 1020102, 201, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10201, 0.0, "2025/01/31 12:00:00", 61, 6, "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 133801, 15.5, "ネネカ", 1020103, 301, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10202, 0.0, "2025/02/28 12:00:00", 61, 2, "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 134301, 9.061, "ランファ", 1020201, 101, 5);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10202, 0.0, "2025/02/28 12:00:00", 61, 1, "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 134401, 7.699, "チカ", 1020202, 201, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10203, 0.0, "2025/03/31 12:00:00", 61, 1, "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 134601, 8.595, "アオイ", 1020301, 101, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10203, 0.0, "2025/03/31 12:00:00", 61, 1, "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 134501, 7.758, "クローチェ", 1020302, 201, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10204, 0.0, "2025/04/30 12:00:00", 61, 2, "2030/01/01 14:59:59", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 132302, 7.0, "ルイズマリー", 1020401, 101, 6);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10204, 0.0, "2025/04/30 12:00:00", 61, 1, "2030/01/01 14:59:59", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 132402, 7.904, "イロハ", 1020402, 201, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10204, 0.0, "2025/04/30 12:00:00", 61, 4, "2030/01/01 14:59:59", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 132502, 8.487, "ソノ", 1020403, 301, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10205, 0.0, "2025/05/31 12:00:00", 61, 1, "2030/01/01 14:59:59", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 134901, 8.763, "カノン", 1020502, 101, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10205, 0.0, "2025/05/31 12:00:00", 61, 1, "2030/01/01 14:59:59", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 134801, 6.417, "ツムギ", 1020503, 201, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10206, 0.0, "2025/06/30 12:00:00", 61, 3, "2030/01/01 14:59:59", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 135001, 10.335, "エリス", 1020601, 101, 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10206, 0.0, "2025/06/30 12:00:00", 61, 2, "2030/01/01 14:59:59", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 135101, 6.281, "シェフィ", 1020602, 201, 4);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10206, 0.0, "2025/06/30 12:00:00", 61, 1, "2030/01/01 14:59:59", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 135201, 12.244, "プレシア", 1020603, 301, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10207, 0.0, "2025/07/31 12:00:00", 61, 2, "2030/01/01 14:59:59", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 135301, 6.339, "クリア", 1020701, 101, 8);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10207, 0.0, "2025/07/31 12:00:00", 61, 7, "2030/01/01 14:59:59", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 135401, 8.184, "アネモネ", 1020702, 201, 9);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10208, 0.0, "2025/08/31 12:00:00", 61, 9, "2030/01/01 14:59:59", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 129101, 3.906, "アイラ", 1020801, 101, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10208, 0.0, "2025/08/31 12:00:00", 61, 1, "2030/01/01 14:59:59", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 129201, 14.465, "シナツ", 1020802, 201, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10208, 0.0, "2025/08/31 12:00:00", 61, 4, "2030/01/01 14:59:59", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 100101, 8.662, "ヒヨリ", 1020803, 301, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10208, 0.0, "2025/08/31 12:00:00", 61, 1, "2030/01/01 14:59:59", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 100301, 10.915, "レイ", 1020804, 401, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10209, 0.0, "2025/09/30 12:00:00", 61, 1, "2030/01/01 14:59:59", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 135802, 6.042, "ユキノ", 1020901, 101, 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10209, 0.0, "2025/09/30 12:00:00", 61, 4, "2030/01/01 14:59:59", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 135903, 9.402, "サツキ", 1020902, 201, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10209, 0.0, "2025/09/30 12:00:00", 61, 8, "2030/01/01 14:59:59", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 136902, 8.16, "ルルィ", 1020903, 301, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10210, 0.0, "2025/10/31 12:00:00", 61, 3, "2030/01/01 14:59:59", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 137402, 5.0, "カスミ", 1021001, 101, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10210, 0.0, "2025/10/31 12:00:00", 61, 4, "2030/01/01 14:59:59", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 136001, 8.12, "アラクネ", 1021002, 201, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (-285.0, 10210, 0.0, "2025/10/31 12:00:00", 61, 4, "2030/01/01 14:59:59", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 136202, 6.386, "ナーナ", 1021003, 301, 2);
